import Header from '../components/header.js';
import Footer from '../components/footer.js';

function Contact()
{
    return(
        <>
        <Header />
        <div className='w-full h-[700px] max-[640px]:h-[200px] relative flex items-center justify-center pl-10 pr-10 ' />
        <Footer />
        </>
    )
}

export default Contact;
